import logo from './logo.svg';
import './App.css';
import { Route,Link,R } from 'react-router-dom';
import CreditScoringCard from './Components/Pages/CreditScoringCard';
import CreditScoringList from './Components/CreditScoringList';
import LandingPage from './Components/LandingPage';


function App() {
  return (
    <Router>
      <div className="App">
        <Link to="/add-scorecard"> {/* Use Link to navigate */}
          <button type="button" className="btn2">
            Add ScoreCard
          </button>
        </Link>

        <Route exact path="/add-scorecard" component={CreditScoringCard} />
        <Route path="/" component={CreditScoringList} />
      </div>
    </Router>
  );
}

export default App;
